import React from 'react';
import logo from './logo.svg';
import './App.css';

import {BrowserRouter} from "react-router-dom"

function App() {
    return (
        <BrowserRouter>
            <div className="App">
                <h1>Md Sohrab Hossain Sohel</h1>
            </div>
        </BrowserRouter>
    );
}

export default App;
